import React from 'react';
import { Box, Card, CardContent, Typography, Grid, Chip, Divider } from '@mui/material';

export default function ComprehensiveReportDisplay({ report }) {
    if (!report) {
        return (
            <Box sx={{ width: '100vw', height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'linear-gradient(120deg, #e3f2fd 60%, #fffde7 100%)' }}>
                <Typography variant="h4" color="primary" sx={{ fontWeight: 'bold' }}>
                    Please upload a video to start analysis.
                </Typography>
            </Box>
        );
    }

    // Extract key fields from report
    const aj = report.analysis_json || {};
    const frameAnalysis = aj.frame_analysis || aj.image?.details?.frame_analysis || [];
    const audioAnalysis = aj.audio_analysis || {};
    const videoInfo = aj.video_info || {};
    const violationCategories = frameAnalysis.violation_categories || aj.violation_categories || [];
    const transcript = audioAnalysis.transcript || '';
    const badWords = audioAnalysis.bad_words || [];
    const badPatterns = audioAnalysis.bad_patterns || [];
    const framesAnalyzed = frameAnalysis.total_frames || aj.frames_analyzed || frameAnalysis.length || 0;
    const safeFrames = frameAnalysis.safe_frames || aj.safe_frames || 0;
    const complianceRate = framesAnalyzed ? ((safeFrames / framesAnalyzed) * 100).toFixed(1) : 'N/A';
    const copyrightResult = report.copyright_check || {};

    return (
        <Box sx={{ width: '100vw', height: '100vh', p: 4, background: 'linear-gradient(120deg, #e3f2fd 60%, #fffde7 100%)', overflow: 'auto' }}>
            <Typography variant="h4" sx={{ fontWeight: 'bold', mb: 2, color: '#1976d2' }}>
                Video Moderation Report
            </Typography>
            <Divider sx={{ mb: 3 }} />
            <Grid container spacing={3}>
                <Grid item xs={12} md={4}>
                    <Card sx={{ boxShadow: 3, borderRadius: 3 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>Video Info</Typography>
                            <Typography variant="body2">Duration: <b>{videoInfo.duration || videoInfo.duration_formatted || 'N/A'}</b></Typography>
                            <Typography variant="body2">Resolution: <b>{videoInfo.resolution || 'N/A'}</b></Typography>
                            <Typography variant="body2">FPS: <b>{videoInfo.fps || 'N/A'}</b></Typography>
                            <Typography variant="body2">Frames Analyzed: <b>{framesAnalyzed}</b></Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={12} md={4}>
                    <Card sx={{ boxShadow: 3, borderRadius: 3 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>Frame Analysis</Typography>
                            <Typography variant="body2">Safe Frames: <b>{safeFrames}</b></Typography>
                            <Typography variant="body2">Compliance Rate: <b>{complianceRate}%</b></Typography>
                            <Typography variant="body2">Violations:</Typography>
                            {violationCategories.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {violationCategories.map((cat, idx) => (
                                        <Chip key={idx} label={cat} color="error" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">No violations detected.</Typography>
                            )}
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={12} md={4}>
                    <Card sx={{ boxShadow: 3, borderRadius: 3 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>Audio Analysis</Typography>
                            <Typography variant="body2">Transcript:</Typography>
                            <Typography variant="body2" sx={{ fontStyle: 'italic', mb: 1 }}>{transcript || 'No transcript available.'}</Typography>
                            <Typography variant="body2">Bad Words:</Typography>
                            {badWords.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {badWords.map((word, idx) => (
                                        <Chip key={idx} label={word} color="warning" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">None detected.</Typography>
                            )}
                            <Typography variant="body2">Bad Patterns:</Typography>
                            {badPatterns.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {badPatterns.map((pat, idx) => (
                                        <Chip key={idx} label={pat} color="warning" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">None detected.</Typography>
                            )}
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
            <Divider sx={{ my: 4 }} />
            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Copyright Check</Typography>
            <Card sx={{ boxShadow: 2, borderRadius: 2, mb: 4 }}>
                <CardContent>
                    <Typography variant="body2">Status: <b>{copyrightResult.status || 'N/A'}</b></Typography>
                    <Typography variant="body2">Details: <b>{copyrightResult.details || 'No details available.'}</b></Typography>
                </CardContent>
            </Card>
            <Divider sx={{ my: 4 }} />
            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Raw Report</Typography>
            <Card sx={{ boxShadow: 1, borderRadius: 2 }}>
                <CardContent>
                    <pre style={{ fontSize: '0.95rem', background: '#f5f5f5', padding: 12, borderRadius: 4, maxHeight: 400, overflow: 'auto' }}>{JSON.stringify(report, null, 2)}</pre>
                </CardContent>
            </Card>
        </Box>
    );
}
